def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if ratios[i] < 0.25:
            priorities[i] = np.power(np.sin(item) + np.cos(bins[i]), 2) + np.sqrt(item * bins[i])
        elif ratios[i] >= 0.25 and ratios[i] < 0.5:
            priorities[i] = np.tan(item) + np.tan(bins[i]) * np.sqrt(item)
        elif ratios[i] >= 0.5 and ratios[i] < 0.75:
            priorities[i] = np.log(np.abs(item - bins[i]) + 1) / np.sqrt(item)
        else:
            priorities[i] = np.arctan(np.sqrt(item * bins[i])) - np.cosh(ratios[i])

    for j in range(len(bins)):
        if priorities[j] < 15:
            priorities[j] *= 2
        elif priorities[j] >= 15 and priorities[j] < 30:
            priorities[j] += 5
        elif priorities[j] >= 30 and priorities[j] < 45:
            priorities[j] -= 3
        else:
            priorities[j] = np.log(priorities[j])

    for k in range(len(bins)):
        if priorities[k] % 3 == 0:
            priorities[k] += item * 2
        elif priorities[k] % 3 == 1:
            priorities[k] -= item / 2
        else:
            priorities[k] += np.sqrt(item)

        if item > 15:
            priorities[k] *= 1.8
        else:
            priorities[k] = np.exp(priorities[k])

    return priorities
